import React, { Component } from 'react'

export class SearchBar extends Component {
    render() {
        return (
            <div>
              <form id="searchItemForm">
                <input
                type="text"
                id="addInput"
                placeholder="BookSearcher9000"
                />
                <button className="button" onClick={this.addItem}>
                Search Book
                </button>
              </form>
            </div>
        )
    }
}

export default SearchBar
